import React, { useEffect, useState } from "react";

export default function Splash() {
    const [redirectNow, setRedirectNow] = useState(false);
    setTimeout(() => setRedirectNow(true), 2000);
    return redirectNow ? (
        <Redirect to="/home" />
    ) : (
        <div className="SplashScreen">
            <h1>Hello World</h1>
        </div>
    );
}
